// 该文件专门用于创建整个应用的路由器
import VueRouter from 'vue-router'
//引入路由组件
import Home from "../pages/Home"
import Latest from "../pages/Latest";
import Login from "../pages/Login";

export default new VueRouter({
    routes:[
        {
            name:'home',
            path:'/home',
            component:Home
        },
        {
            name:'latest',
            path:'/latest',
            component:Latest
        },
        {
            name:'login',
            path:'/login/',
            component:Login
        }
    ]
})
